function ImageUpload() {
  return (
    <div>
      <div className={styles.uploadBox}>
        <label htmlFor="batteryImages">
          <i className="fa-solid fa-arrow-up-from-bracket"></i>
        </label>
        <img id="output" className={styles.outputImage} />
      </div>
    </div>
  );
}

export default ImageUpload;
